import { useState } from 'react';

function App() {
  const [buttoncolor, setButtonColor] = useState('white');
  const handleClick = () => {
    setButtonColor('red');
  };

  return (
    <button className="circle" onClick={handleClick} style={{ backgroundColor: {buttoncolor} }}>1</button>
  )
}

export default App;
